t: 28px; font-size: 15px;">	要开发一个尺寸更大，更先进的 iPhone
显示屏，就要在设计上大大突破极限。从金属与玻璃的精密结合，到光滑圆润的流线机身，每处细节都是深思熟虑的结晶，旨在带给你更为出众的使用体验。因此，
虽然 iPhone 6 的显示屏变大了，但却让人感觉大得恰到好处。</p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 240px 0px 0px 80px; color: rgb(51, 51, 51); line-height: 48px; letter-spacing: 2px; font-size: 25px;"><span style="line-height: 70px; font-size: 65px;">6.9</span> 毫米</p><p><br/></p><p style="margin: 0px; padding: 0px 0px 0px 90px; color: rgb(51, 51, 51); line-height: 22px; letter-spacing: 2px; font-size: 15px;">	iPHONE 6</p><p><br/></p><p style="margin: 0px; padding: 25px 0px 0px 80px; color: rgb(51, 51, 51); line-height: 48px; letter-spacing: 1px; font-size: 25px;"><span style="line-height: 70px; font-size: 65px;">7.1</span> 毫米</p><p><br/></p><p style="margin: 0px; padding: 0px 0px 0px 90px; color: rgb(51, 51, 51); line-height: 22px; letter-spacing: 1px; font-size: 15px;">	iPHONE 6 PLUS</p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 20px 0px 0px; text-align: center;"><img src="http://goodsimg.1yyg.com/GoodsInfo/20140910144019403.jpg"/></p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 120px 0px 0px 20px; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 2px; font-size: 42px;">	不仅更大<br/>	更大放异彩</p><p><br/></p><p style="margin: 0px; padding: 20px 10px 0px 20px; width: 390px; line-height: 28px; font-size: 15px;">	把显示屏做大并非难事，但打造一块将绚丽色彩、更高对比度、更广阔浏览视角集于一身的大尺寸 Multi-Touch 显示屏，则完全是另一个境界的事。 而这，也正是我们在全新 Retina HD 高清显示屏上所做到的。</p><p><br/></p><p style="margin: 0px; padding: 20px 0px 0px 20px; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 2px; font-size: 42px;">	1334×750</p><p><br/></p><p style="margin: 0px; padding: 0px 10px 0px 20px; width: 390px; line-height: 28px; font-size: 16px;">	iPHONE 6分辨率</p><p><br/></p><p style="margin: 0px; padding: 10px 0px 0px 20px; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 2px; font-size: 42px;">	1920×1080</p><p><br/></p><p style="margin: 0px; padding: 0px 10px 0px 20px; width: 390px; line-height: 28px; font-size: 16px;">	iPHONE 6 PLUS 分辨率</p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 265px 0px 0px 20px; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 2px; font-size: 42px;">	大有动力,大有能效。</p><p><br/></p><p style="margin: 0px; padding: 20px 10px 0px 20px; width: 390px; line-height: 28px; font-size: 15px;">	新一代 A8 芯片基于 64 位台式电脑级架构，可提供更为强劲的动力，即使是驱动这样一个更大的显示屏也游刃有余。M8
运动协处理器则能通过先进的传感器和全新的气压计来高效地收集数据。再加上提升的电池使用时间，iPhone 6 能让你拥有更多时间，去做到更多。</p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 320px 0px 0px; text-align: center; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 2px; font-size: 38px;">	一个相机，改变了摄影，<br/>	又将颠覆摄像。</p><p><br/></p><p style="margin: 0px; padding: 20px 10px 0px 20px; text-align: center; line-height: 28px; font-size: 15px;">	越来越多的人喜欢用 iPhone 来随时随地拍摄照片。而现在，配备全新传感器的 iSight 摄像头不仅支持 Focus
Pixels，还新增更多视频功能。比如你可以拍摄 60 fps 的 1080p HD 高清视频，240 fps
的慢动作视频，还可以选择延时摄影模式。因此，你将有更多理由用视频去捕捉更多的美好时刻，就像拍照一样简单自然。</p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 20px 10px 0px 160px; line-height: 22px; font-size: 12px;">	全新的传感器支持 Focus Pixels，<br/>	可实现更快的自动对焦。</p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 100px 0px 0px 430px; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 2px; font-size: 42px;">	更快无线连接，<br/>	连接更宽广。</p><p><br/></p><p style="margin: 0px; padding: 20px 10px 0px 430px; width: 350px; line-height: 28px; font-size: 15px;">	有了更快的 4G LTE 网络下载速度*，以及更多 LTE 频段支持，iPhone 6 能让你在更广阔的天地，更自由地遨游。而当你接入无线网络时，还能体验到快达 3 倍的无线网络速度。</p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 140px 0px 0px 20px; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 2px; font-size: 42px;">	安全，全凭指尖。</p><p><br/></p><p style="margin: 0px; padding: 20px 10px 0px 20px; width: 360px; line-height: 28px; font-size: 15px;">	突破性的 Touch ID 技术让你安全访问自己的 iPhone 有了独一无二的密码：你的指纹。并且，这一方式还能用来确认你在 iBooks 和 App Store 中的下载或购买，从而无需再输入密码。</p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 140px 0px 0px 430px; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 2px; font-size: 42px;">	有史以来极其重大的 iOS 版本</p><p><br/></p><p style="margin: 0px; padding: 20px 10px 0px 430px; width: 350px; line-height: 28px; font-size: 15px;">	iOS 8 是了不起的先进移动操作系统，它以令人惊叹的全新功能和特性，将大显示屏的优势尽致呈现。对 iPhone 6 来说，这不仅仅是一次软硬件间宛如天成的绝佳匹配，更是创造了一种将每个细微之处，都变得大为出众的绝佳体验。</p><p><br/></p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 20px 0px 5px 5px; line-height: 25px; font-size: 18px;">	重要说明：</p><p><br/></p><p style="margin: 0px; padding: 0px 0px 5px 5px; line-height: 22px; font-size: 14px;">	1、1元云购将在商品到货后第一时间按订单顺序发出。</p><p><br/></p><p style="margin: 0px; padding: 0px 0px 5px 5px; line-height: 22px; font-size: 14px;">	2、商品获得者拥有苹果（Apple）iPhone 6 A1586 16G版 4G手机 10年免费使用权。</p><p><br/></p><p style="margin: 0px; padding: 0px 0px 5px 5px; line-height: 22px; font-size: 14px;">	3、1元云购对本商品使用权在法律范围内拥有最终解释权。</p><p><br/></p><p><br/></p>\',\'shopcodes_1\',\'0\',\'1\',\'1\',\'1450187596\',\'1\',\'N\',\'0\')',
